import React, { useState } from "react";

const Counterr = () => {
  const [num, setNum] = useState(0);

  const Countt = () => {
    setNum(num + 1);
  };
  return (
    <>
      <button onClick={Countt}>Click Me {num}</button>
    </>
  );
};

export default Counterr;
